import React from "react";

export default function ProjectSelector(props){
  const selectedProject = props.selectedProject;
  const selectProject = props.selectProject;
  return(
    <div className="project-selector">
      <div className="select-number" onClick={() => selectProject([selectedProject[0]])}>1</div>
      <div className="select-number"onClick={() => selectProject([selectedProject[1]])}>2</div>
      <div className="select-number" onClick={() => selectProject([selectedProject[2]])}>3</div>
    </div>
  )
}
